import fetch from 'node-fetch'

const fetcher = url => fetch(url).then(res => res.json())

export default function Projet({name}){
    return <h1>{name}</h1>
}

export async function getStaticPaths() {
    const url = "https://localhost/3000/api/projets"
    const res = url => fetch(url).then(res => res.json())
    
    return{
        
        paths: [
            {
                params: {
                    projet: 'elite-down'
                }
            },
            {
                params: {
                    projet: 'fallen-forest'
                }
            }
        ],
        fallback: false
    }
}

export async function getStaticProps({params}) {
    return {
        props:{
            name: "Elite Down"
        }
    }
}
